import React, { Component } from "react";
import InteractButtonsComponent from "../post/interactButtonsComponent";

//Styled Components
import { PostContainer } from "../../styled/posts/postContainer";
import { Post } from "../../styled/posts/post";
import { PostInfo } from "../../styled/posts/postInfo";
import { PostTitle } from "../../styled/posts/postTitle";
import { FiveList } from "../../styled/posts/fiveList";
import { SocialBar } from "../../styled/posts/socialBar";
import { HashtagCloud } from "../../styled/posts/hashtagCloud";
 
export default class Feed extends Component {
  render() {
    return (
      <div>

    <PostContainer>
        <Post>
            <PostInfo>
                <p>User1 posted</p>
            </PostInfo>
            
            <PostTitle>
                <p>Top 5 Post-Title</p>
            </PostTitle>

            <FiveList>
                <ol>
                    <li>Platz 1</li>
                    <li>Platz 2</li>
                    <li>Platz 3</li>
                    <li>Platz 4</li>
                    <li>Platz 5</li>
                </ol>
            </FiveList>

            <SocialBar>
                    <HashtagCloud>
                     <p>#Hashtags</p>
                    </HashtagCloud>

                     
                     <InteractButtonsComponent />
                    
            </SocialBar>

        </Post>


    </PostContainer>


      </div>
    );
  }
}
